INSERT INTO `administracion_politica` VALUES (75,NULL,'Bienvenido a la página Web de Diners Club International. Esta sección explica nuestra política referente a cualquier información que pueda proveernos cuando visite nuestra página Web.\r\n\r\nLa presente política de privacidad para protección de datos de carácter personal del USUARIO (en adelante USUARIO) aplica a todo: servicios, función, software, canal o servicio electrónico como sitios web, aplicaciones móviles y demás similares; a menos que explícitamente se indique lo contrario. Nuestra meta es proteger su información en estos canales, tal como lo hacemos en agencias, cajeros automáticos y call center; donde, como USUARIO libre y voluntariamente facilita sus datos personales.\r\n\r\nLa política DINERS Club para la privacidad en los servicios electrónicos es:\r\n\r\nEl uso de los servicios electrónicos por parte de cada USUARIO, implica la aceptación de esta policita de privacidad; para que, determine libre y voluntariamente si desea facilitar a DINERS los datos personales que se le puedan solicitar para la suscripción de los Servicios Electrónicos.\r\nEn caso que el USUARIO facilite información personal como su dirección, correo electrónico, teléfonos etc., ésta no será revelada a terceros a menos que: se haya comunicado al USUARIO previamente; el USUARIO lo haya autorizado; o, sea requerido por ley.\r\nLos Datos Personales serán objeto de tratamiento automatizado e incorporados a los correspondientes archivos automatizados de datos de carácter personal de los que DINERS será titular y responsable. Con este objeto, DINERS proporcionará al USUARIO los recursos técnicos adecuados para que preste de forma inequívoca su consentimiento a fin de que DINERS pueda proceder al tratamiento automatizado de sus Datos Personales y para que, con carácter previo a la prestación de dicho consentimiento, pueda acceder a este aviso sobre la Política de Privacidad para Protección de Datos de DINERS o a cualquier otra información relevante.\r\nLa incorporación al Archivo y tratamiento automatizado de los Datos Personales tiene como finalidad la vinculación del USUARIO con DINERS y su respectivo mantenimiento, gestión, administración, prestación, ampliación, mejora, envío de actualizaciones de los servicios que se haya suscrito el USUARIO ; así como, la disposición de nuevos servicios que puedan ser del interés del USUARIO, envío por medios tradicionales y electrónicos de información técnica, operativa y comercial acerca de productos, promociones y servicios ofrecidos por DINERS actualmente y en el futuro.\r\nLa finalidad de la inscripción y tratamiento automatizado de los Datos Personales incluye igualmente el envío de formularios de encuestas, que el USUARIO no queda obligado a contestar. Por lo tanto, DINERS deberá obtener el previo consentimiento del USUARIO para utilizar sus datos con finalidades diferentes a las mencionadas en esta política.\r\nDINERS ha adoptado niveles de seguridad adecuados para proteger los Datos Personales legalmente requeridos y ha instalado todos los medios y medidas técnicas a su alcance para evitar la pérdida, mal uso, alteración, acceso no autorizado y robo de los Datos Personales facilitados a DINERS en sus servicios electrónicos. No obstante, el USUARIO debe ser consciente de que las medidas de seguridad en los servicios electrónicos no son inexpugnables y el USUARIO deberá mantener las precauciones del caso para no entregar sus datos personales en sitios falsos.\r\nSalvo en los campos en que se indique lo contrario, las respuestas a las preguntas sobre Datos Personales son voluntarias, sin que la falta de contestación a dichas preguntas implique una merma en la calidad o cantidad de los servicios correspondientes, a menos que se indique lo contrario.\r\nEl USUARIO informado otorga su consentimiento, previo y expresamente a DINERS para que éste pueda realizar cualquier operación o conjunto de operaciones tales como la recolección, almacenamiento, uso o transferencia de la información de los Datos Personales a terceros para publicidad de servicios y productos, tanto de DINERS como de sus establecimientos afiliados, precautelando siempre que el USUARIO no surtirá perjuicio alguno como consecuencia de esta acción.\r\nDINERS se reserva el derecho a modificar la presente política para adaptarla a novedades legislativas o jurisprudenciales, así como a prácticas válidas de la industria, en cuyos casos DINERS anunciará en esta página los cambios introducidos con razonable antelación a su puesta en práctica. Incluso, ciertos servicios ofrecidos en los servicios electrónicos o a través de los canales disponibles pueden contener condiciones particulares con previsiones específicas en materia de privacidad y protección de Datos Personales. En consecuencia, en estos casos se informará al USUARIO tales condiciones, que tendrán prelación sobre el presente reglamento.\r\nDINERS mantendrá la información personal, así como las actividades y transacciones de su negocio con la seguridad y estándares de confidencialidad acostumbrados, para lo cual cumple con las normativas locales y cuenta con la certificación PCI DSS.\r\nLos usuarios pueden requerir el registro y modificación de la información referente a su número de telefonía móvil y correo electrónico por canales presenciales, o bajo condiciones de seguridad que incluyan métodos de autenticación fuertes por canales digitales, o a través del call center previa validación de la identidad del cliente.','2020-11-08',NULL),(76,NULL,'Es importante recalcar el hecho de que actualmente empleamos el citado término unido de manera indisoluble a otro concepto dando lugar a la expresión “libro de texto”. Con ella intenta definirse a aquel libro u obra que es el que se emplea en los distintos centros escolares para que el alumno aprenda una materia concreta.\r\n\r\nDe esta forma podríamos establecer como ejemplo el siguiente: “El profesor ordenó a todos los estudiantes que sacaran de sus mochilas el libro de texto de Matemáticas para poder empezar la clase”.\r\n\r\nAsimismo, tampoco podemos pasar por alto que existe una terminología muy concreta que se utiliza desde tiempos inmemoriales en nuestra sociedad. Nos estamos refiriendo a lo que se conoce como Sagrado Texto o Texto Sagrado, un concepto con el que se define a La Biblia, que es el conjunto de libros que ejerce como pilar fundamental de las religiones cristiana y judía.\r\n\r\nEn ocasiones, la noción de texto se utiliza para nombrar al cuerpo de una obra impresa o manuscrita, en oposición a aquello que va por separado. El texto, por lo tanto, es sólo el cuerpo principal de un libro, quedando fuera la portada, el índice, los apéndices, etc.\r\n\r\nEntre las características de un texto, se encuentran la coherencia (las distintas posturas e informaciones que expone deben ayudar a formar una idea general), la cohesión (todas las secuencias de significado tienen que estar relacionadas entre sí) y la adecuación (debe estar en condiciones de llegar a su lector ideal).\r\n\r\nLos textos, por otra parte, guardan relación con otros textos para generar sentido. Esto quiere decir que un texto siempre es interpretado a través de un marco de referencia.\r\n\r\nPara terminar hay que subrayar que en el ámbito de la tecnología y, en concreto, en el de la informática se hace también un uso bastante extendido del término que estamos analizando. En concreto, se habla de lo que se conoce como procesador de textos que es un programa gracias al cual el usuario puede escribir en su ordenador diversos documentos. Word y OpenOffice Writer son los dos procesadores de este tipo más importantes y de uso más generalizado.\r\n\r\nDe la misma forma a este proceso de escritura en computadora así como a la edición de la misma a través de dicha herramienta se le da en llamar procesamiento de textos.\r\nCada texto posee una cierta finalidad comunicativa: por medio de sus signos busca transmitir un cierto mensaje que adquiere sentido de acuerdo a cada contexto. La extensión del texto es muy variable, desde unas pocas palabras hasta millones de ellas. De hecho, un texto es virtualmente infinito.\r\n\r\nMás allá del concepto básico (el texto como unidad de sentido), el mismo término permite hacer referencia a cosas bastantes distintas entre sí. En este sentido, un libro completo, una frase de un periódico, un chat a través de Internet y una conversación en un bar incluyen textos.','2020-11-08',NULL),(77,NULL,'Es importante recalcar el hecho de que actualmente empleamos el citado término unido de manera indisoluble a otro concepto dando lugar a la expresión “libro de texto”. Con ella intenta definirse a aquel libro u obra que es el que se emplea en los distintos centros escolares para que el alumno aprenda una materia concreta.\r\n\r\nAsimismo, tampoco podemos pasar por alto que existe una terminología muy concreta que se utiliza desde tiempos inmemoriales en nuestra sociedad. Nos estamos refiriendo a lo que se conoce como Sagrado Texto o Texto Sagrado, un concepto con el que se define a La Biblia, que es el conjunto de libros que ejerce como pilar fundamental de las religiones cristiana y judía.\r\n\r\nEn ocasiones, la noción de texto se utiliza para nombrar al cuerpo de una obra impresa o manuscrita, en oposición a aquello que va por separado. El texto, por lo tanto, es sólo el cuerpo principal de un libro, quedando fuera la portada, el índice, los apéndices, etc.\r\n\r\nEntre las características de un texto, se encuentran la coherencia (las distintas posturas e informaciones que expone deben ayudar a formar una idea general), la cohesión (todas las secuencias de significado tienen que estar relacionadas entre sí) y la adecuación (debe estar en condiciones de llegar a su lector ideal).\r\n\r\nLos textos, por otra parte, guardan relación con otros textos para generar sentido. Esto quiere decir que un texto siempre es interpretado a través de un marco de referencia.\r\n\r\nPara terminar hay que sub