uerpo de una obra impresa o manuscrita, en oposición a aquello que va por separado. El texto, por lo tanto, es sólo el cuerpo principal de un libro, quedando fuera la portada, el índice, los apéndices, etc.\r\n\r\n\r\nEntre las características de un texto, se encuentran la coherencia (las distintas posturas e informaciones que expone deben ayudar a formar una idea general), la cohesión (todas las secuencias de significado tienen que estar relacionadas entre sí) y la adecuación (debe estar en condiciones de llegar a su lector ideal).\r\n\r\n\r\nLos textos, por otra parte, guardan relación con otros textos para generar sentido. Esto quiere decir que un texto siempre es interpretado a través de un marco de referencia.\r\n\r\n\r\nPara terminar hay que subrayar que en el ámbito de la tecnología y, en concreto, en el de la informática se hace también un uso bastante extendido del término que estamos analizando. En concreto, se habla de lo que se conoce como procesador de textos que es un programa gracias al cual el usuario puede escribir en su ordenador diversos documentos. Word y OpenOffice Writer son los dos procesadores de este tipo más importantes y de uso más generalizado.\r\n\r\n\r\nDe la misma forma a este proceso de escritura en computadora así como a la edición de la misma a través de dicha herramienta se le da en llamar procesamiento de textos.\r\n\r\n\r\nCada texto posee una cierta finalidad comunicativa: por medio de sus signos busca transmitir un cierto mensaje que adquiere sentido de acuerdo a cada contexto. La extensión del texto es muy variable, desde unas pocas palabras hasta millones de ellas. De hecho, un texto es virtualmente infinito.\r\n\r\n\r\nMás allá del concepto básico (el texto como unidad de sentido), el mismo término permite hacer referencia a cosas bastantes distintas entre sí. En este sentido, un libro completo, una frase de un periódico, un chat a través de Internet y una conversación en un bar incluyen textos.','2020-12-19',NULL),(79,NULL,'Términos y Condiciones de Uso\r\n \r\nINFORMACIÓN RELEVANTE\r\nAl utilizar este sitio, usted acepta estos términos y condiciones. Si no está de acuerdo, no debe utilizar esta app.\r\nEs requisito necesario para la adquisición de los productos que se ofrecen en este sitio, que lea y acepte los siguientes Términos y Condiciones que a continuación se redactan. El uso de nuestros servicios así como la compra de nuestros productos implicará que usted ha leído y aceptado los Términos y Condiciones de Uso en el presente documento. Todas los productos  que son ofrecidos por nuestra app pudieran ser creadas, cobradas, enviadas o presentadas por una página app tercera y en tal caso estarían sujetas a sus propios Términos y Condiciones. En algunos casos, para adquirir un producto, será necesario el registro por parte del usuario, con ingreso de datos personales fidedignos y definición de una contraseña.\r\nEl usuario puede elegir y cambiar la clave para su acceso de administración de la cuenta en cualquier momento, en caso de que se haya registrado y que sea necesario para la compra de alguno de nuestros productos.  Cabuto`s no asume la responsabilidad en caso de que entregue dicha clave a terceros.\r\nTodas las compras y transacciones que se lleven a cabo por medio de este sitio, están sujetas a un proceso de confirmación y verificación, el cual podría incluir la verificación del stock y disponibilidad de producto, validación de la forma de pago, validación de la factura (en caso de existir) y el cumplimiento de las condiciones requeridas por el medio de pago seleccionado. En algunos casos puede que se requiera una verificación por medio de correo electrónico.\r\nLos precios de los productos ofrecidos en esta App son válidos solamente en las compras realizadas en este sitio.\r\n\r\nLICENCIA\r\nA través de su sitio concede una licencia para que los usuarios utilicen  los productos que son vendidos en este sitio  de acuerdo a los Términos y Condiciones que se describen en este documento.\r\n\r\nUSO NO AUTORIZADO\r\nEn caso de que aplique (para venta de software, templetes, u otro producto de diseño y programación) usted no puede colocar uno de nuestros productos, modificado o sin modificar, en un CD, sitio web o ningún otro medio y ofrecerlos para la redistribución o la reventa de ningún tipo.\r\n\r\nRESTRICCIÓN DE RESPONSABILIDAD\r\nCabuto`s no será responsable de daños o lesiones que provoquen, de manera enunciativa mas no limitativa, fallos de desempeño, errores, omisiones, interrupciones, defectos, demoras en la operación de transmisión, virus informáticos o fallas en la línea. Cauto`s Cabuto`s  no será responsable de daños o lesiones, incluyendo de manera enunciativa mas no limitativa, daños y perjuicios especiales o indirectos que resulten del uso, o la incapacidad de uso, de los materiales del sitio, incluso si existe negligencia de Cabuto`s  o uno de sus representantes autorizados ha sido informado de la posibilidad de dichos daños y perjuicios, o ambos. La limitación o exclusión anteriores pueden no ser aplicables a usted en la medida en que las leyes aplicables puedan no permitir la limitación o exclusión de responsabilidad para daños y perjuicios incidentales o indirectos. La responsabilidad total de Cabuto`s ante usted por pérdidas, daños y perjuicios y hechos base de la acción (por contrato, responsabilidad extracontractual (incluyendo, de manera enunciativa mas no limitativa, negligencia), o de otra forma) no serán superiores a la suma que usted pagó para acceder a este sitio.\r\n\r\nPROPIEDAD\r\nUsted no puede declarar propiedad intelectual o exclusiva a ninguno de nuestros productos, modificado o sin modificar. Todos los productos son propiedad  de los proveedores del contenido. En caso de que no se especifique lo contrario, nuestros productos se proporcionan  sin ningún tipo de garantía, expresa o implícita. En ningún momento esta compañía será  responsable de ningún daño incluyendo, pero no limitado a, daños directos, indirectos, especiales, fortuitos o consecuentes u otras pérdidas resultantes del uso o de la imposibilidad de utilizar nuestros productos.\r\n\r\nPOLÍTICA DE REEMBOLSO Y GARANTÍA\r\nEn el caso de productos que sean  mercancías irrevocables no-tangibles (recargas o servicios), no realizamos reembolsos después de que se envíe el producto, usted tiene la responsabilidad de entender antes de comprarlo.  Le pedimos que lea cuidadosamente antes de comprarlo. Hacemos solamente excepciones con esta regla cuando la descripción no se ajusta al producto. Hay algunos productos que pudieran tener garantía y posibilidad de reembolso pero este será especificado al comprar el producto. \r\nAsí mismo se aplicará reembolso cuando el producto no llegue al sitio indicado y que no conste en la foto que le será enviada antes de ser transportada por el motorizado o repartidor. Es importante revisar todo el pedido con la persona que le entrega para confirmar que todo llega en buenas condiciones y si algo no llega bien se procederá a un reajuste analizando con la foto y con la persona que despacha ese producto para proceder al descuento a la persona que hace las entregas o al local si el producto no fue enviado. Si en el momento que revisa el pedido, usted encuentra un producto caducado, el local le cambiará por otro sin costo adicional de entrega y si por algún motivo ese producto no cuenta con stock,  se llamará al cliente para darle una solución o reembolso. Una vez revisado y aceptado por el cliente ya no se acepta reclamo alguno por deterioro o por estar caducado.\r\nUna vez que sale el producto o mercadería del local, NO se aceptan devoluciones y si el pedido no fue recibido por responsabilidad del cliente (no había quien reciba, no se encontró dirección o no hubo respuesta telefónica), se le volverá a enviar acordando con el cliente lapso de tiempo y con un recargo por el valor del servicio de entrega. Si los productos no se reciben el día de la compra por responsabilidad del cliente, en caso que sean perecibles, como frutas, legumbres o de pronta caducidad, el establecimiento no se hace responsable\r\n\r\nCOMPROBACIÓN ANTIFRAUDE\r\nLa compra del cliente puede ser aplazada para la comprobación antifraude. También puede ser suspendida por más tiempo para una investigación más rigurosa, para evitar transacciones fraudulentas.\r\n\r\nPRIVACIDAD\r\nEste  garantiza, que su información personal de la app Cabuto’s  subida en el playstore https://play.google.com/store/apps/details?id=io.cabutos.starter.v2&hl=es cuenta con la seguridad necesaria. Los datos ingresados por usuario o en el caso de requerir una validación de los pedidos, no serán entregados a terceros, salvo que deba ser revelada en cumplimiento a una orden judicial o requerimientos legales.\r\n\r\nSe reserva los derechos de cambiar o de modificar estos términos sin previo aviso.\r\n','2021-06-12',NULL),(80,NULL,'Términos y Condiciones de Uso\r\n \r\nINFORMACIÓN RELEVANTE\r\nAl utilizar este sitio, usted acepta estos términos y condiciones. Si no está de acuerdo, no debe utilizar esta app.\r\nEs requisito necesario para la adquisición de los productos que se ofrecen en este sitio, que lea y acepte los siguientes Términos y Condiciones que a continuación se redactan. El uso de nuestros servicios así como la compra de nuestros productos implicará que usted ha leído y aceptado los Términos y Condiciones de Uso en el presente documento. Todas los productos  que son ofrecidos por nuestra app pudieran ser creadas, cobradas, enviadas o presentadas por una página app tercera y en tal caso estarían sujetas a sus propios Términos y Condiciones. En algunos casos, para adquirir un producto, será necesario el registro por parte del usuario, con ingreso de datos personales fidedignos y definición de una contraseña.\r\nEl usuario puede elegir y cambiar la clave para su acceso de administración de la cuenta en cualquier momento, en caso de que se haya registrado y que sea necesario para la compra de alguno